import React, { useState } from 'react'

export default function Home() {
    const [count, setCount] = useState(0)

    const counter = () => {
        setCount(count + 1)
    }

    return (
        <>
            <h1>HOME {{count}}</h1>
            <button onClick={() => counter}>Contar</button>
        </>
    )
}
